import Expenseitem from "./components/expenseitem";
function App() {
  const expense=[
    {name:'Car insurance',price:'34.6',date:new Date(2020,3,2)},
    {name:'Mortgage',price:'3400.7',date:new Date(2020,3,1)},
    {name:'Car EMI',price:'34.6',date:new Date(2020,3,20)}
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenseitem />  {/* must always start with always Capital letter. */}
      <Expenseitem />
    </div>
  );
}

export default App;
